import React from "react";
import { FaShoppingCart } from "react-icons/fa";
import { NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <div>
      <div className="flex flex-row justify-between">
        <NavLink to="/">
          <div>
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcT_EilJPN97OZKztnghpjMqQUUr08v3BBOjJw&usqp=CAU" />
          </div>
        </NavLink>
        <NavLink to="/">
          <div>
            <p>HOME</p>
          </div>
        </NavLink>
        <NavLink to="/Cart">
          <div>
            <FaShoppingCart />
          </div>
        </NavLink>

        <div></div>
      </div>
    </div>
  );
};

export default Navbar;
